import axios from 'axios';
const loginEntity = { "login": "letscode", "senha": "lets@123" };

const login = () => {
  const promise = axios.post('http://0.0.0.0:5000/login/', loginEntity);

  promise.then((response) => console.log(response.data));

  const yourJWTToken = '';

  const headers = {
    Authorization: `Bearer ${yourJWTToken}`
  }

  // yourConfig = headers;
};

export default login;
